paths:
  tmp0:
    post:
      description: Get a page of alarms
      parameters:
      - description: Only return alarms that were received after this time.  Can be
          any time format, see README for relative time format.
        example: '{time.now():-100days}'
        in: query
        name: Timestamp Received Minimum
        required: true
        schema: {type: string}
      - description: Only return alarms that were received before this time. defaults
          to the current time.  Can be any time format, see README for relative time
          format.
        example: '{time.now():+0days}'
        in: query
        name: Timestamp Received Maximum
        required: false
        schema: {type: string}
      - description: The maximum number of results to return
        example: '10'
        in: body
        name: Limit
        required: false
        schema: {type: string}
      - description: Which direction to sort in (based on timestamp_received). either
          "asc" or "desc".
        example: desc
        in: query
        name: Sort
        required: false
        schema: {type: string}
      - description: A comma separated list of statuses.  Only alarms with one of
          these statuses will be returned.
        example: open
        in: query
        name: Status
        required: false
        schema: {type: string}
      - description: A comma separated list of priority labels.  Only alarms with
          one of these priority labels will be returned.
        example: low,medium
        in: query
        name: Priority Label
        required: false
        schema: {type: string}
      - description: A comma separated list of rule intents.  Only alarms with one
          of these rule intents will be returned.
        example: Environmental Awareness,Another intent
        in: query
        name: Rule Intent
        required: false
        schema: {type: string}
      - description: Determines whether to grab suppressed results.
        example: 'False'
        in: query
        name: Suppressed
        required: false
        schema: {type: boolean}
      - description: A comma separated list of rule methods.  Only alarms with one
          of these rule methods will be returned.
        example: User Account Locked
        in: query
        name: Rule Method
        required: false
        schema: {type: string}
      - description: A comma separated list of rule strategies.  Only alarms with
          one of these rule strategies will be returned.
        example: Suspicious Behavior
        in: query
        name: Rule Strategy
        required: false
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp0'}
          description: Successful request
      summary: Alienvault USM Central Get Alarms
  tmp1:
    post:
      description: Retrieve the asset matching the given ID.
      parameters:
      - description: The ID of the asset.
        example: 8ab53297-d602-4e1a-850f-5b85a966ef6b
        in: query
        name: ID
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp1'}
          description: Successful request
      summary: Alienvault USM Central Get Asset
  tmp2:
    post:
      description: Get a page of events
      parameters:
      - description: The `sort` parameter specifies direction that the results should
          be sorted by.
        example: asc
        in: query
        name: Sort
        required: false
        schema: {type: string}
      - description: The maximum number of events to return.
        example: '3'
        in: body
        name: Limit
        required: false
        schema: {type: string}
      - description: Minutes ago the event was received.
        example: '60'
        in: query
        name: Minutes Ago
        required: false
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp2'}
          description: Successful request
      summary: Alienvault USM Central Get Events
  tmp3:
    post:
      description: Get all events associated with the given alarm uuid.
      parameters:
      - description: The uuid of the alarm to grab the events for.
        example: 54ec57e0-e198-f60b-246c-6f25626f8a79
        in: query
        name: ID
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp3'}
          description: Successful request
      summary: Alienvault USM Central Get Events for Alarm
